sprites.onOverlap(SpriteKind.EnemyProjectile, SpriteKind.Player, function (sprite, otherSprite) {
    if (Render.isSpritesOverlapZ(sprite, otherSprite)) {
        if (sprite.y > otherSprite.y) {
            statusbar.value += -5
            sprite.destroy()
        } else {
            sprite.destroy()
        }
    }
    sprite.destroy()
})
function makeFakeBuilding () {
    for (let value of tiles.getTilesByType(assets.tile`myTile5`)) {
        hallway = sprites.create(assets.image`myImage7`, SpriteKind.Scenery)
        tiles.placeOnTile(hallway, tiles.getTileLocation(value.column, value.row))
        hallway.y += 8
        Render.setZOffset(hallway, -1)
    }
    tiles.replaceAllTiles(assets.tile`myTile5`, assets.tile`transparency16`)
    for (let value2 of tiles.getTilesByType(assets.tile`myTile6`)) {
        hallway = sprites.create(assets.image`myImage8`, SpriteKind.Scenery)
        tiles.placeOnTile(hallway, tiles.getTileLocation(value2.column, value2.row))
        hallway.y += 8
        Render.setZOffset(hallway, -1)
    }
    tiles.replaceAllTiles(assets.tile`myTile6`, assets.tile`transparency16`)
    for (let value3 of tiles.getTilesByType(assets.tile`myTile7`)) {
        hallway = sprites.create(assets.image`car30`, SpriteKind.Scenery)
        tiles.placeOnTile(hallway, tiles.getTileLocation(value3.column, value3.row))
        scaling.scaleToPercent(hallway, 50, ScaleDirection.Uniformly, ScaleAnchor.Bottom)
        Render.setZOffset(hallway, -1)
    }
    tiles.replaceAllTiles(assets.tile`myTile7`, assets.tile`transparency16`)
    for (let value4 of tiles.getTilesByType(assets.tile`myTile13`)) {
        ENEMY_BULLET_SPAWNER = sprites.create(assets.image`myImage9`, SpriteKind.e_bullet_spawn)
        tiles.placeOnTile(ENEMY_BULLET_SPAWNER, tiles.getTileLocation(value4.column, value4.row))
        scaling.scaleToPercent(ENEMY_BULLET_SPAWNER, 200, ScaleDirection.Uniformly, ScaleAnchor.Bottom)
        sprites.setDataNumber(ENEMY_BULLET_SPAWNER, "health", 3)
        Render.setZOffset(ENEMY_BULLET_SPAWNER, -1)
    }
    tiles.replaceAllTiles(assets.tile`myTile13`, assets.tile`transparency16`)
}
sprites.onOverlap(SpriteKind.Projectile, SpriteKind.EnemyProjectile, function (sprite, otherSprite) {
    sprite.destroy()
    otherSprite.destroy()
    music.zapped.play()
})
function makeHallways () {
    for (let value5 of tiles.getTilesByType(assets.tile`myTile2`)) {
        hallway = sprites.create(assets.image`myImage4`, SpriteKind.Scenery)
        tiles.placeOnTile(hallway, tiles.getTileLocation(value5.column, value5.row))
        hallway.y += 8
        Render.setZOffset(hallway, 16)
        animation.runImageAnimation(
        hallway,
        assets.animation`myAnim`,
        200,
        true
        )
    }
    tiles.replaceAllTiles(assets.tile`myTile2`, assets.tile`transparency16`)
    for (let value5 of tiles.getTilesByType(assets.tile`myTile16`)) {
        hallway = sprites.create(assets.image`myImage11`, SpriteKind.Scenery)
        tiles.placeOnTile(hallway, tiles.getTileLocation(value5.column, value5.row))
        hallway.y += 8
        Render.setZOffset(hallway, 16)
    }
    tiles.replaceAllTiles(assets.tile`myTile16`, assets.tile`transparency16`)
}
statusbars.onZero(StatusBarKind.Health, function (status) {
	
})
function missionMenu () {
    intro_scene_sprite2.destroy()
    textSprite.destroy()
    myMenu = miniMenu.createMenu(
    miniMenu.createMenuItem("Mission 1"),
    miniMenu.createMenuItem("Mission 2"),
    miniMenu.createMenuItem("Mission 3"),
    miniMenu.createMenuItem("Mission 4")
    )
    myMenu.setDimensions(120, 60)
    myMenu.setStyleProperty(miniMenu.StyleKind.Selected, miniMenu.StyleProperty.Background, 12)
    myMenu.setStyleProperty(miniMenu.StyleKind.Selected, miniMenu.StyleProperty.Foreground, 1)
    myMenu.setPosition(20, 30)
    myMenu.setFlag(SpriteFlag.RelativeToCamera, true)
    myMenu.onButtonPressed(controller.A, function (selection, selectedIndex) {
        if (selectedIndex == 0) {
            myMenu.close()
            mission1setup()
        }
    })
}
sprites.onOverlap(SpriteKind.Projectile, SpriteKind.e_bullet_spawn, function (sprite, otherSprite) {
    if (sprites.readDataNumber(otherSprite, "health") > 0) {
        music.zapped.play()
        otherSprite.setImage(assets.image`myImage10`)
        pause(100)
        otherSprite.setImage(assets.image`myImage9`)
        sprites.changeDataNumberBy(otherSprite, "health", -1)
        sprite.destroy()
    } else {
        sprite.destroy()
        otherSprite.destroy()
    }
})
scene.onHitWall(SpriteKind.Projectile, function (sprite, location) {
    music.bigCrash.play()
    sprite.destroy()
})
scene.onHitWall(SpriteKind.EnemyProjectile, function (sprite, location) {
    music.bigCrash.play()
    sprite.destroy()
})
